import React from 'react';
import { Player } from 'video-react';
import ReactPlayer from 'react-player'
import './styles.module.scss';

export class _Videos extends React.Component{
    render () {
        return <div className="vid">
            <table>
                <tr>
                    <td><ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' playing /> <p className="hashtags">rtr</p> </td>
                    <td><ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' playing /></td>
                    <td><ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' playing /></td>
                    </tr>
                <tr> <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' playing />
                    </tr>
            <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' playing />
            </table>
            </div>
    }
}
